CREATE TABLE tst01.ebay
(
    id bigint(20) unsigned PRIMARY KEY NOT NULL,
    url varchar(1024),
    pid int(11),
    ebaydata longtext,
    description text,
    pic_url varchar(1024),
    our_price int(11),
    approved tinyint(1) DEFAULT '1' NOT NULL
);
CREATE UNIQUE INDEX ebay_id_uindex ON tst01.ebay (id);
